import React from 'react'
import logo from "../images/logos-removebg-preview.png";
function Foot(props) {
  return (
    <div style={{height:"8rem",alignItems:"center",flexDirection:"column"}} className=' d-flex   justify-content-between mt-5'>
      <div><img src={logo} alt="logo" style={{width:"3rem"}} /></div>
      <div className={`text-${props.mode==='light'?"dark":"light"}`}> Â© Copyright 2021. All right reserved</div>
      <div>
      <span data-bs-toggle="tooltip" data-bs-placement="top" title="Facebook"><a blank href="https://www.facebook.com/md.shoyeb.98096/"> <i className={`uil text-${props.mode==='light'?"dark":"light"} fs-2 px-4  uil-facebook`}></i> </a></span>
      <span data-bs-toggle="tooltip" data-bs-placement="top" title="Linkedin"> <a blank href="https://www.linkedin.com/in/md-shoyeb-49645020a">  <i className={`uil text-${props.mode==='light'?"dark":"light"} fs-2 px-4 uil-linkedin`}></i></a></span>
      <span data-bs-toggle="tooltip" data-bs-placement="top" title="Github"> <a blank href="https://github.com/shoyebmd424"> <i className={`uil text-${props.mode==='light'?"dark":"light"} fs-2 px-4 uil-github`}></i></a></span>
      <span data-bs-toggle="tooltip" data-bs-placement="top" title="whatsapp">   <a blank href="https://wa.me/919871904481"> <i className={`uil text-${props.mode==='light'?"dark":"light"} fs-2 px-4 uil-whatsapp`}></i> </a></span>
      </div>
    </div>
  )
}

export default Foot;
